        public static List<Route> index = new() {
                new() {
                    Name = "Hello Handler",
                    UrlRegex = @"^/$",
                    Method = "GET",
                    Host = string.Empty,
                    Callable = (HttpRequest request) => {
                        bool handled = false;
                        foreach (string indexFile in HTTPUtils.DefaultDocuments)
                        {
                            if (File.Exists(Path.Combine(HTTPServerConfiguration.HTTPStaticFolder, indexFile)))
                            {
                                handled = true;

                                string? encoding = request.GetHeaderValue("Accept-Encoding");

                                if (!string.IsNullOrEmpty(encoding) && encoding.Contains("gzip"))
                                {
                                    using (FileStream stream = new(indexFile, FileMode.Open, FileAccess.Read, FileShare.ReadWrite))
                                    {
                                        byte[]? buffer = null;

                                        using (MemoryStream ms = new())
                                        {
                                            stream.CopyTo(ms);
                                            buffer = ms.ToArray();
                                            ms.Flush();
                                        }

                                        stream.Flush();

                                        return HttpResponse.Send(HTTPUtils.Compress(buffer), "text/html", new string[][] { new string[] { "Content-Encoding", "gzip" } });
                                    }
                                }
                                else
                                    return HttpResponse.Send(new FileStream(indexFile, FileMode.Open, FileAccess.Read, FileShare.ReadWrite), "text/html");
                            }
                        }

                        if (!handled)
                        {
                            return new HttpResponse(false)
                                {
                                    HttpStatusCode = HttpStatusCode.NotFound,
                                    ContentAsUTF8 = string.Empty
                                };
                        }

                        return new HttpResponse(false)
                            {
                                HttpStatusCode = HttpStatusCode.InternalServerError,
                                ContentAsUTF8 = string.Empty
                            };
                     }
                },
                new() {
                    Name = "UFC Home Connector",
                    UrlRegex = "/index.php",
                    Method = "POST",
                    Host = "sonyhome.thqsandbox.com",
                    Callable = (HttpRequest request) => {
                        if (request.getDataStream != null)
                        {
                            string? UFCResult = THQ.ProcessUFCUserData(request.getDataStream, HTTPUtils.ExtractBoundary(request.GetContentType()));
                            if (!string.IsNullOrEmpty(UFCResult))
                                return HttpResponse.Send(UFCResult, "text/xml");
                        }

                        return new HttpResponse(false)
                            {
                                HttpStatusCode = HttpStatusCode.InternalServerError,
                                ContentAsUTF8 = string.Empty
                            };
                     }
                },
                new() {
                    Name = "DLNA Discovery",
                    UrlRegex = "/!DLNADiscovery/",
                    Method = "GET",
                    Host = string.Empty,
                    Callable = (HttpRequest request) => {
                        string clientip = request.IP;
                        if ((HTTPServerConfiguration.AllowedIPs != null && HTTPServerConfiguration.AllowedIPs.Contains(clientip)) || clientip == "127.0.0.1" || clientip.ToLower() == "localhost")
                        {
                            SSDP.Start(); // Start a service as this will take a long time
                            Thread.Sleep(14000); // Wait for each TV/Device to reply to the broadcast
                            SSDP.Stop(); // Stop the service if it has not stopped already
                            List<DlnaDeviceInfo> devices = new();
                            // 2 Threads only.
                            Parallel.ForEach(SSDP.Servers.Split(' '), new ParallelOptions { MaxDegreeOfParallelism = 2 }, url => {
                                string? xmlContent = FetchDLNARemote.FetchXmlContent(url);
                                if (!string.IsNullOrEmpty(xmlContent))
                                   devices.Add(FetchDLNARemote.ParseXml(xmlContent, url));
                            });
                            string? encoding = request.GetHeaderValue("Accept-Encoding");
                            if (!string.IsNullOrEmpty(encoding) && encoding.Contains("gzip"))
                                return HttpResponse.Send(HTTPUtils.Compress(Encoding.UTF8.GetBytes(JsonConvert.SerializeObject(devices, Formatting.Indented))), "application/json;charset=UTF-8", new string[][] { new string[] { "Content-Encoding", "gzip" } });
                            else
                                return HttpResponse.Send(JsonConvert.SerializeObject(devices, Formatting.Indented), "application/json;charset=UTF-8");
                        }

                        return HttpBuilder.NotAllowed();
                     }
                },
                new() {
                    Name = "DLNA play",
                    UrlRegex = "/!DLNAPlay/$",
                    Method = "GET",
                    Host = string.Empty,
                    Callable = (HttpRequest request) => {
                        string clientip = request.IP;
                        if (((HTTPServerConfiguration.AllowedIPs != null && HTTPServerConfiguration.AllowedIPs.Contains(clientip)) || clientip == "127.0.0.1" || clientip.ToLower() == "localhost") && request.QueryParameters != null)
                        {
                            string? src = request.QueryParameters["src"];
                            string? dst = request.QueryParameters["dst"];

                            if (!string.IsNullOrEmpty(src) && !string.IsNullOrEmpty(dst))
                            {
                                DLNADevice Device = new(src);
                                if (Device.IsConnected())
                                    return HttpResponse.Send($"DLNA Player returned {Device.TryToPlayFile(dst)}");
                                else
                                    return HttpResponse.Send("Failed to send to TV");
                            }
                        }

                        return HttpBuilder.NotAllowed();
                     }
